import ArticleEmployment from 'components/common/ArticleEmployment';
import React from 'react';
import styled from 'styled-components';

function BookmarkPage() {
	return (
		<ComponentWrapper>
			<nav role="presentation" className="Nav_Nav__mBpI5">
				<h2 className="Nav_Nav_title__4b9t6">
					<p>북마크</p>
				</h2>
			</nav>
			<div className="Bookmark_container__3HsyN">
				<div className="List_List__kDrrx">
					<div className="List_List_container__JnQMS">
						<ul data-cy="job-list" className="clearfix">
							<li>
								<ArticleEmployment />
							</li>
						</ul>
						<div />
					</div>
				</div>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.Nav_Nav__mBpI5 {
		position: relative;
		line-height: normal;
		p {
			font-size: 20px;
			font-weight: 700;
			color: #333;
			padding: 50px 0 20px;
		}
	}

	.List_List_container__JnQMS > ul {
		margin: -10px;
		padding: 0;
		li {
			width: 25%;
			padding: 10px;
			list-style: none;
			display: inline-block;
			vertical-align: top;
		}
	}

	.clearfix:before {
		content: ' ';
		display: table;
	}
	.clearfix:after {
		clear: both;
	}
`;

export default BookmarkPage;
